`,paraId:17,tocIndex:7},{value:`// 1.\u5411\u94FE\u8868\u5C3E\u90E8\u8FFD\u52A0\u6570\u636E
LinkedList.prototype.append = function (data) {
  var newNode = new Node(data);
  // \u82E5\u94FE\u8868\u4E3A\u7A7A
  if (this.length === 0) {
    // \u5C06head\u6307\u5411\u7B2C\u4E00\u4E2A\u8282\u70B9
    this.head = newNode;
  } else {
    var current = this.head;
    // \u5F53current.next\u4E3Anull \u7684\u65F6\u5019\u4F1A\u9000\u51FA\u5FAA\u73AF
    while (current.next) {
      // \u6307\u9488\u540E\u79FB
      current = current.next;
    }
    // \u5F53\u6307\u5230\u6700\u540E\u4E00\u4E2Anode\u65F6\uFF0C\u7ED9next append newNode
    current.next = newNode;
  }
  // \u6CE8\u610F\uFF1Aappend\u540E\u957F\u5EA6\u8981+1
  this.length += 1;
};
`,paraId:18,tocIndex:8},{value:"\u9996\u5148\u8BA9 ",paraId:19,tocIndex:9},{value:"currentNode",paraId:19,tocIndex:9},{value:" \u6307\u5411\u7B2C\u4E00\u4E2A\u8282\u70B9\u3002",paraId:19,tocIndex:9},{value:`
