console.log(linked.get(5)); // 55
`,paraId:27,tocIndex:15},{value:`// 5.\u8FD4\u56DE\u6570\u636E\u5F53\u524D\u4F4D\u7F6E,\u82E5\u627E\u4E0D\u5230\u4F20\u5165\u6570\u636E\u7684\u4F4D\u7F6E\uFF0C\u8FD4\u56DE-1
LinkedList.prototype.indexOf = function (data) {
  var current = this.head;
  var index = 0;
  while (current) {
    if (current.data === data) return index;
    current = current.next;
    index += 1;
  }
  return -1;
};
