  MIN_VAL = -Math.pow(2, 31);
/**
 * @param {number} a
 * @param {number} b
 * @return {number}
 */
var divide = function (a, b) {
  if (b === 1) return a;
  if (b === -1) return a === MIN_VAL ? MAX_VAL : -a;
  if (a === 0) return 0;

  // \u5224\u65AD\u6B63\u8D1F
  const flag = (a ^ b) >= 0;
  a = a < 0 ? a : -a;
  b = b < 0 ? b : -b;

  let res = 0;
  while (a <= b) {
    let base = 1;
    let divisor = b;
    while (a - divisor <= divisor) {
      base <<= 1;
      divisor <<= 1;
    }
    res += base;
    a -= divisor;
  }
  return flag ? res : -res;
};
