var lowestCommonAncestor = function (root, p, q) {
  // base case
  if (root === null) return null;
  // \u524D\u5E8F\u904D\u5386\u4F4D\u7F6E
  // \u5728\u5411\u4E0B\u9012\u5F52\u7684\u8FC7\u7A0B\u4E2D\uFF08\u5206\u53C9\uFF09\uFF0C\u82E5\u53D1\u73B0p\u6216q\uFF0C\u90A3\u4E48\u5C31\u8FD4\u56DE\u627E\u5230\u7684\u8282\u70B9
  if (root === q || root === p) return root;
  const left = lowestCommonAncestor(root.left, p, q);
  const right = lowestCommonAncestor(root.right, p, q);

  // \u540E\u5E8F\u904D\u5386
  // 1.\u53D1\u73B0left\u548Cright\u90FD\u6709\u503C\uFF0C\u90A3\u4E48\u8BF4\u660Eroot\u662Fans
  if (left !== null && right !== null) return root;

  // 2.\u53D1\u73B0left\u548Cright\u90FD\u6CA1\u6709\u503C\uFF0C\u90A3\u4E48\u8BF4\u660E\u6CA1\u6709ans\uFF0C\u8FD4\u56DEnull
  // \u5305\u542B\u5728\u4E86\u6700\u4E0B\u9762\u7684\u5143\u5224\u65AD\u4E2D\uFF0C\u53EF\u4EE5\u7701\u7565
  // if (left === null && right === null) return null;

  // 3.\u82E5\u53EA\u6709\u4E00\u8FB9\u6709\u503C\uFF0C\u8BF4\u660E\u5728\u540C\u4E00\u8FB9\uFF0C\u8FD4\u56DE\u53E6\u4E00\u8FB9\u6700\u8FD1\u627E\u5230\u7684\u4F5C\u4E3Aans
  return left === null ? right : left;
};
`,paraId:224,tocIndex:46},{value:"\u5251\u6307 Offer 07. \u91CD\u5EFA\u4E8C\u53C9\u6811",paraId:0},{value:"medium",paraId:225,tocIndex:46},{value:"\u8DDF",paraId:226,tocIndex:47},{value:"105.\u4ECE\u524D\u5E8F\u4E0E\u4E2D\u5E8F\u904D\u5386\u5E8F\u5217\u6784\u9020\u4E8C\u53C9\u6811",paraId:227,tocIndex:47},{value:"\u76F8\u540C",paraId:226,tocIndex:47},{value:`/**
 * Definition for a binary tree node.
 * function TreeNode(val) {
 *     this.val = val;
 *     this.left = this.right = null;
 * }
 */
/**
 * @param {number[]} preorder
 * @param {number[]} inorder
 * @return {TreeNode}
 */
var buildTree = function (preorder, inorder) {
  /**
    preorder = [3,  9,  20,  15,  7]
                \u2B06  |l|  |    r   |
                \u6839

    inorder =  [9,  3,  15,  20,  7]
               |l|  \u2B06   |    r   |
                    \u6839
    \u5B9A\u4E49\uFF1A
    \u524D\u5E8F\u904D\u5386\u6570\u7EC4\u4E3Apreorder[preStart,preEnd]
    \u4E2D\u5E8F\u904D\u5386\u6570\u7EC4\u4E3Ainorder[inStart,inEnd]
    \u6784\u9020\u8FD9\u4E2A\u4E8C\u53C9\u6811\uFF0C\u5E76\u8FD4\u56DE\u6839\u8282\u70B9
    */
  const build = (preStart, preEnd, inStart, inEnd) => {
    if (preStart > preEnd) return null;
    const rootVal = preorder[preStart]; // \u524D\u5E8F\u904D\u5386\u7684\u7B2C\u4E00\u4E2A\u8282\u70B9\u662F\u6839\u7ED3\u70B9
    const index = inorder.indexOf(rootVal); // \u5728\u4E2D\u5E8F\u904D\u5386\u4E2D\u627E\u5230\u6839\u8282\u70B9\u7684index\uFF0C\u6839\u8282\u70B9\u5DE6\u8FB9\u662F\u5DE6\u5B50\u6811\uFF0C\u53F3\u8FB9\u662F\u53F3\u5B50\u6811
    const leftSize = index - inStart; // \u5728\u4E2D\u5E8F\u904D\u5386\u4E2D \u6839\u8282\u70B9 - \u5F00\u59CB = leftSize

    const root = new TreeNode(rootVal);
    // \u5DE6\u5B50\u6811\uFF0C\u524D\u5E8F\u7D22\u5F15 \uFF08preStart + 1\uFF0CpreStart + leftSize\uFF09 \u4E2D\u5E8F\u7D22\u5F15\uFF08inStart,rootIndex -1\uFF09
    root.left = build(preStart + 1, preStart + leftSize, inStart, index - 1);
    // \u53F3\u5B50\u6811 \u524D\u5E8F\uFF08preStart + leftSize + 1, preEnd\uFF09 \u4E2D\u5E8F(rootIndex+1,inEnd)
    root.right = build(preStart + leftSize + 1, preEnd, index + 1, inEnd);
    return root;
  };

  return build(0, preorder.length - 1, 0, inorder.length - 1);
};
`,paraId:228,tocIndex:47},{value:"\u5251\u6307 Offer 16. \u6570\u503C\u7684\u6574\u6570\u6B21\u65B9",paraId:0},{value:"medium",paraId:229,tocIndex:47},{value:"\u8DDF",paraId:230,tocIndex:48},{value:"50.Pow(x, n)",paraId:231,tocIndex:48},{value:"\u76F8\u540C",paraId:230,tocIndex:48},{value:`/**
 * @param {number} x
 * @param {number} n
 * @return {number}
 */
var myPow = function (x, n) {
  if (n === 0) return 1;

  // n\u662F\u8D1F\u6570
  if (n < 0) {
    return myPow(1 / x, -n);
  }

  // n\u662F\u5947\u6570
  if (n % 2 === 1) {
    return x * myPow(x, n - 1);
  } else {
    // n \u662F\u5076\u6570
    const sub = myPow(x, n / 2);
    return sub * sub;
  }
};
