`,paraId:235,tocIndex:49},{value:"\u7EC8\u6B62\u6761\u4EF6\uFF0C\u5F53 i>=j,\u8BF4\u660E\u53EA\u6709\u4E00\u4E2A\u8282\u70B9\u4E86\uFF0C\u4E0D\u7528\u5224\u65AD\u6B63\u786E\u6027\uFF0C\u8FD4\u56DE true",paraId:236,tocIndex:49},{value:"\u58F0\u660E\u6307\u9488\uFF0C\u5BFB\u627E[i,j]\u4E2D\uFF0C\u7B2C\u4E00\u4E2A\u5927\u4E8E j \u7684\u5143\u7D20\u4E3A m\uFF0C\u8BF4\u660E[i,m-1]\u662F\u5DE6\u5B50\u6811\uFF0C[m,j]\u662F\u53F3\u5B50\u6811",paraId:236,tocIndex:49},{value:"\u7136\u540E\u5224\u65AD\u5DE6\u5B50\u6811\u662F\u5426\u90FD\u5C0F\u4E8E\u6839\u8282\u70B9\uFF0C\u53F3\u5B50\u6811\u662F\u5426\u90FD\u5927\u4E8E\u6839\u8282\u70B9",paraId:236,tocIndex:49},{value:"\u5728\u533A\u5206\u5DE6\u53F3\u5B50\u6811\u7684\u65F6\u5019\uFF0C\u5176\u5B9E\u5DF2\u7ECF\u5224\u65AD\u4E86\u5DE6\u5B50\u6811\u90FD\u6BD4\u6839\u8282\u70B9\u5C0F\u4E86\uFF0C\u53EA\u9700\u8981\u7EE7\u7EED\u53BB\u5224\u65AD\u53F3\u5B50\u6811\u7684\u6709\u6548\u6027",paraId:236,tocIndex:49},{value:"\u5C06\u6307\u5411 m \u7684\u6307\u9488 p \u7EE7\u7EED\u540E\u79FB\uFF0C\u5224\u65AD\u6761\u4EF6\u662F[m,j]\u7684\u5143\u7D20\u90FD\u662F\u5927\u4E8E\u6839\u8282\u70B9\uFF0C\u82E5\u786E\u5B9E\u5982\u6B64\uFF0C\u6307\u9488 p \u6700\u540E\u4F1A\u6307\u5411 j",paraId:236,tocIndex:49},{value:"\u5224\u65AD j===p\uFF0C\u53EF\u4EE5\u5224\u65AD\u5F53\u524D\u6570\u7EC4\u662F\u5426\u7B26\u5408\u7279\u6027",paraId:236,tocIndex:49},{value:"\u82E5\u7B26\u5408\u7279\u6027\uFF0C\u9012\u5F52\u8FDB\u53BB\uFF0C\u5224\u65AD\u5DE6\u53F3\u5B50\u6811\u662F\u5426\u300C\u90FD\u6EE1\u8DB3\u300D",paraId:236,tocIndex:49},{value:"return j===p && f[i,m-1] && f[m,j-1]",paraId:236,tocIndex:49},{value:`/**
 * @param {number[]} postorder
 * @return {boolean}
 */
var verifyPostorder = function (postorder) {
  return traverse(postorder, 0, postorder.length - 1);
};

var traverse = function (postorder, i, j) {
  // base case
  if (i >= j) return true;
  let p = i;
  while (postorder[p] < postorder[j]) p++;
  let m = p; // m\u7528\u6765\u533A\u5206\u5DE6\u53F3\u5B50\u6811[i,m-1] [m,j];
  while (postorder[p] > postorder[j]) p++; // \u5224\u65AD\u540E\u9762\u7684\u5143\u7D20\uFF0C\u662F\u5426\u6BD4\u6839\u300Cj\u300D\u5927
  // \u82E5p===j\uFF0C\u8BF4\u660E\u662F[i,j]\u6EE1\u8DB3\u540E\u5E8F\u904D\u5386\u7684\u7279\u6027
  // \u7EE7\u7EED\u5224\u65AD\u5DE6\u53F3\u5B50\u6811\u662F\u5426\u6EE1\u8DB3\u7279\u6027
  return (
    p === j && traverse(postorder, i, m - 1) && traverse(postorder, m, j - 1)
  );
};
