var addOne = function (s, j) {
  const charts = s.split('');
  if (charts[j] === '9') {
    charts[j] = '0';
  } else {
    charts[j] = Number(charts[j]) + 1;
  }
  return charts.join('');
};

// \u5C06\u5B57\u7B26\u4E32s[j]\u5411\u4E0B\u62E8\u52A8\u4E00\u6B21
var minusOne = function (s, j) {
  const charts = s.split('');
  if (charts[j] === '0') {
    charts[j] = '9';
  } else {
    charts[j] = Number(charts[j]) - 1;
  }
  return charts.join('');
};

/**
 * @param {string[]} deadends
 * @param {string} target
 * @return {number}
 */
var openLock = function (deadends, target) {
  const q = ['0000'];
  const visited = new Set();
  visited.add('0000');

  let deep = 0;

  while (q.length !== 0) {
    const len = q.length;
    for (let i = 0; i < len; i++) {
      const current = q.shift();

      // \u7EC8\u6B62\u6761\u4EF6
      if (deadends.indexOf(current) !== -1) continue;
      if (current === target) return deep;

      for (let j = 0; j < 4; j++) {
        const upStr = addOne(current, j);
        if (!visited.has(upStr)) {
          q.push(upStr);
          visited.add(upStr);
        }

        const downStr = minusOne(current, j);
        if (!visited.has(downStr)) {
          q.push(downStr);
          visited.add(downStr);
        }
      }
    }

    deep++;
  }
  // \u82E5\u5FAA\u73AF\u7ED3\u675F\u8FD8\u6CA1\u6709\u627E\u5230\u5BC6\u7801\uFF0C\u8FD4\u56DE-1\uFF1B
  return -1;
};
